public TokenInfo(
        String text,
        String rawText,
        String type,
        int start,
        int end,
        int position,
        String positionHistory,
        String payload,
        boolean match) {

  this.text = text;
  this.rawText = rawText;
  this.type = type;
  this.start = start;
  this.end = end;
  this.position = position;
  this.positionHistory = positionHistory;
  this.payload = payload;
  this.match = match;
}

